import React, { useState } from "react";
import '../fw-cuisining.css';

const Testing = () => {
  const [modalVisible, setModalVisible] = useState(false);

  const openModal = () => {
    setModalVisible(true);
  };

  const closeModal = () => {
    setModalVisible(false);
  };

  return (
    <>
      {/* Modal */}
      <div className={`modal-overlay ${modalVisible ? 'show' : ''}`}>
        <div className="cmodal">
          <div className="cmodal-header">
            <h5 className="cmodal-title">Modal Title</h5>
            <button className="cmodal-close" onClick={closeModal}>
              Ã—
            </button>
          </div>
          <div className="cmodal-body">
            <p>asdasdasd</p>
          </div>
          <div className="cmodal-footer">
            <button className="cbtn cbtn-secondary" onClick={closeModal}>
              Close
            </button>
            <button className="cbtn cbtn-primary">Okay</button>
          </div>
        </div>
      </div>

      <div className="c-container">
        <h1 className="d-flex b-dashed justify-content-center align-items-center">
          Testing Page
        </h1>
        <div className="d-flex justify-content-center">
          <a href="#" className="cbtn cbtn-primary btn-lg">
            btn-lgasdasdasd
          </a>
        </div>

        {/* Button to trigger modal */}
        <button className="cbtn cbtn-primary" onClick={openModal}>
          modal
        </button>
      </div>
    </>
  );
};

export default Testing;
